  render() {
    const { user } = this.props.auth;
    return (
      <div style={{ height: "75vh" }} >
        Wecome to the homepage!
        
            <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.props.logout}
              href="#"
              
            >
              Logout
            </button>
          </div>
        
     
    );
  }
}
